import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <hr />
      <p>Developed by <strong>Debopriyo Choudhury</strong></p>
      
      <div className="footer-icons">
        <a href="mailto:sridebopriyo@gmail.com" target="_blank" rel="noopener noreferrer" title="Email">
          <i className="fas fa-envelope"></i>
        </a>
        <a href="https://www.linkedin.com/in/debopriyo-choudhury-077043275/" target="_blank" rel="noopener noreferrer" title="LinkedIn">
          <i className="fab fa-linkedin"></i>
        </a>
        <a href="https://github.com/DebopriyoChoudhury782004" target="_blank" rel="noopener noreferrer" title="GitHub">
          <i className="fab fa-github"></i>
        </a>
      </div>

      <p>Location: Kolkata, India | Passionate MERN Stack Developer</p>
    </footer>
  );
};

export default Footer;
